import { Box , InputBase, Button, styled } from '@mui/material';

const Container = styled(Box)({
    background: '#445A6F',
    padding: 10 
});

const Input = styled(InputBase)({
    color: '#FFF'

})
    

const Form = () => {

    return (
        <Container>
            <Input 
                placeholder="City"
            />

            <InputBa
                placeholder="Country"
            />
            <Button
                variant="contained"
                >Get Weather</Button>
        </Container>
    )
} 

export default Form;
